__version__ = '1.0'

from nyeda.types.archive import ArchByte
from nyeda.features.bundler import bundler
from nyeda.features.encdec import encrypter
from nyeda.features.encdec import base64tools
from nyeda.exceptions import NYEDAException, NYEDASEG

from pathlib import Path

import subprocess
import tempfile
import pickle
import sys
import os

if sys.platform == 'darwin':
    import pwd

if sys.platform == 'win32':
    import shutil

class Nyeda(bundler, encrypter, base64tools):
    def __init__(
            self,
            source: Path,
            destination: Path,
            *,
            encrypt: bool = False,
            passkey: bytes = base64tools.encode(b'Password!'),
            salt: bytes = base64tools.encode(b'Salted!')
    ) -> None:
        # Normalize the source and the destination
        self.source = source.expanduser().resolve()
        self.destination = self.destpath_normalizer(destination.expanduser().resolve())

        # Check the existence of the source
        if not self.source.exists(): return NYEDASEG(NYEDAException, f'{source} does not exist!')

        # Bundle the source into ArchByte
        self.bundled = self.bundle(self.source)

        # Encrypt the bundled content if necessary
        if encrypt is True:
            # Check the passkey and salt
            if not self.is_urlsafe_b64encoded(passkey): return NYEDASEG(NYEDAException, 'passkey must be url-safe base64 encoded bytes.')
            if not self.is_urlsafe_b64encoded(salt): return NYEDASEG(NYEDAException, 'salt must be url-safe base64 encoded bytes.')

            # encrypt the bundled archive
            self.bundled = self.encrypt(self.bundled, passkey, salt)

            # dump the cryptogram into bytes
            self.bundled = pickle.dumps(self.bundled)

            # encode the cryptogram
            self.bundled = self.encode(self.bundled)

        # Prepare the container
        self.container = self.decode(container).decode().replace(
            'DATA: Union[ArchByte[ArchByteInt], bytes]',
            (f'DATA: Union[ArchByte[ArchByteInt], bytes] = ArchByte({[x for x in self.bundled.__bytes__]})' if isinstance(self.bundled, ArchByte) else f'DATA: Union[ArchByte[ArchByteInt], bytes] = {self.bundled}')
        )

    def bundl(self) -> Path:
        with tempfile.TemporaryDirectory(
            prefix='NYEDA-',
            delete=False
        ) as workdirectory:
            # Move into the work directory
            os.chdir(workdirectory)

            ## Stick to pyinstaller for now
            # Create the executable
            with open(Path(workdirectory, self.destination.name + '.py'), 'w') as execref:
                execref.write(self.container)
            
            # Create the icon file
            with open(Path(workdirectory, self.destination.name + '.ico'), 'wb') as iconref:
                iconref.write(self.decode(icon))
            
            # setup pyinstaller commands
            if sys.platform == 'darwin':
                build = ['sudo', 'pyinstaller', '--onefile', '--clean', '--noconfirm', '--name', self.destination.name]
            else:
                build = ['pyinstaller', '--onefile', '--clean', '--noconfirm', '--name', self.destination.name]

            # Modify build based on os requirements
            if sys.platform == 'win32':
                build.extend(['--uac-admin', '--icon', str(Path(workdirectory, self.destination.name + '.ico'))]) # do not add --noconsole to it.
            if sys.platform == 'darwin':
                build.extend(['--noconsole', '--icon', str(Path(workdirectory, self.destination.name + '.ico'))])
            
            # Finalize the build command
            build.append(str(Path(workdirectory, self.destination.name + '.py')))

            # Execute PyInstaller
            try: subprocess.check_call(build)
            except subprocess.CalledProcessError as e: return NYEDASEG(NYEDAException, 'Buil error!', str(e))

            # Move the created dist/name(.app (in macos), .exe (in windows)) to destination
            if sys.platform == 'darwin': # MacOS
                os.system(f"sudo cp -r {Path(workdirectory, 'dist', self.destination.name + '.app')} {Path(self.destination.parent, self.destination.name + '.app')}")
                os.chdir(self.destination.parent)
                os.system(f"sudo rm -rf {workdirectory}")

                # As it might be run as root, change
                # all permissions to the sudoer
                self._apply_recursive_permission_grant(Path(self.destination.parent, self.destination.name + '.app'), pwd.getpwnam(os.popen('whoami').read().replace('\n', '')))

                return Path(self.destination.parent, self.destination.name + '.app')
            elif sys.platform == 'win32': # Windows
                try: shutil.copyfile(Path(workdirectory, 'dist', self.destination.name + '.exe'), Path(self.destination.parent, self.destination.name + '.exe'))
                except Exception as e: return NYEDASEG(NYEDAException, 'Build error:', str(e))
                
                os.chdir(self.destination.parent)
                shutil.rmtree(workdirectory)

                try:
                    subprocess.check_call(['icacls', str(Path(self.destination.parent, self.destination.name + '.exe')), '/grant', 'Users:(RXF)', '/grant', 'Administrators:(F)'])
                except subprocess.CalledProcessError as e:
                    return NYEDASEG(NYEDAException, 'Build error!', str(e))

                return Path(self.destination.parent, self.destination.name + '.exe')
            else:
    #             shutil.copyfile(
    #                 Path(workdirectory, 'dist', self.destination.name),
    #                 Path(self.destination.parent, self.destination.name)
    #             )
    #             return Path(self.destination.parent, self.destination.name)
                return None

    if sys.platform == 'darwin':
        def _apply_recursive_permission_grant(self, path: Path, user: pwd.struct_passwd) -> None:
            uid_gid = f"{user.pw_uid}:{user.pw_gid}"

            # Change ownership of the directory itself
            os.system(f"sudo chown {uid_gid} '{path}'")

            # Change ownership of the directory contents
            for root, _, files in os.walk(str(path)):
                os.system(f"sudo chown {uid_gid} '{root}'")

                for file in files:
                    os.system(f"sudo chown {uid_gid} '{os.path.join(root, file)}'")
    
    def destpath_normalizer(self, path: Path) -> Path:
        # create all intermediate directories
        path.parent.mkdir(parents=True, exist_ok=True)

        count = 0
        extension = ''
        if sys.platform == 'darwin':
            extension = '.app'
        elif sys.platform == 'win32':
            extension = '.exe'
        
        original = path
        
        while path.exists() or Path(path.parent, path.name + extension).exists():
            path = Path(original.parent, original.name + str(count))
        
        return path

