from argpi import PathWays, Definition
if sys.platform == 'win32':
    import ctypes

class ScriptCfg:
    source: Path
    destination: Path
    encrypt: bool = False
    passkey: bytes = base64tools.encode(b'Password!')
    salt: bytes = base64tools.encode(os.urandom(16))

    arguments = Definition([
        {
            'name': 'Source',
            'value': '--source',
            'short': '-src',
        },
        {
            'name': 'Destination',
            'value': '--destination',
            'short': '-dst'
        },
        {
            'name': 'Encryption',
            'value': '--encrypt',
            'short': '-e'
        },
        {
            'name': 'Passkey',
            'value': '--passkey',
            'short': '-p'
        },
        {
            'name': 'Salt',
            'value': '--salted',
            'short': '-s'
        },
        {
            'name': 'helptext',
            'value': '--help',
            'short': '-h'
        },
        {
            'name': 'FixWinColor',
            'value': '--fix-windows-ansi',
            'short': '--fix-windows-ansi'
        }
    ])

    def SOURCE(self, _: str) -> None:
        self.source = Path(_)
    
    def DESTINATION(self, _: str) -> None:
        self.destination = Path(_)
    
    def ENCRYPT(self) -> None:
        self.encrypt = not self.encrypt
    
    def PASSKEY(self, _: str) -> None:
        self.passkey = base64tools.encode(_.encode())
    
    def SALT(self, _: str) -> None:
        self.salt = base64tools.encode(_.encode())
    
    def HELP(self) -> None:
        import colorama
        colorama.init()
        print(colorama.Fore.BLUE + "Not Your Every-Day Archive (NYEDA)" + colorama.Fore.RESET, f'v{__version__}')
        print('\nHelp\n')
        print('1. Print HelpText:                               -h --help')
        print('2. Set source directory (Mandatory):             -src --source')
        print('3. Set destination directory (Mandatory):        -dst --destination')
        print('4. Set encryption as true:                       -e --encrypt')
        print('5. Set Passkey (Mandatory if encryption is set): -p --passkey')
        print('6. Set encryption salt:                          -s --salted')
        colorama.deinit()
        sys.exit(0)

def getsuperuser():
    if sys.platform == 'win32' and ctypes.windll.shell32.IsUserAnAdmin(): return NYEDASEG(NYEDAException, 'Use an administrator terminal to run this command!')
    else: 
        if os.geteuid()!= 0: 
            return NYEDASEG(NYEDAException, 'Use super user priviledges to run this command!')

def nyeda():
    cfg = ScriptCfg()
    pathway = PathWays(cfg.arguments)
    pathway.register('--help', cfg.HELP, 'EXEC', ())
    pathway.register('--source', cfg.SOURCE, 'EXEC', what_value_expected='Single', ignore_if_not_present=True)
    pathway.register('--destination', cfg.DESTINATION, 'EXEC', what_value_expected='Single', ignore_if_not_present=True)
    pathway.register('--encrypt', cfg.ENCRYPT, 'EXEC', ())
    pathway.register('--passkey', cfg.PASSKEY, 'EXEC', what_value_expected='Single', ignore_if_not_present=True)
    pathway.register('--salted', cfg.SALT, 'EXEC', what_value_expected='Single', ignore_if_not_present=True)
    pathway.orchestrate

    if pathway.if_exec('--help') is False and (pathway.if_exec('--source') is False or pathway.if_exec('--destination') is False): return cfg.HELP()
    if pathway.if_exec('--help'): return None
    if not pathway.if_exec('--source'): return NYEDASEG(NYEDAException, 'source must be given as an argument!')
    if not pathway.if_exec('--destination'): return NYEDASEG(NYEDAException, 'destination must be given as an argument!')

    if cfg.encrypt:
        if sys.platform == 'win32':
            getsuperuser()
        _nyeda = Nyeda(cfg.source, cfg.destination, encrypt=True, passkey=cfg.passkey, salt=cfg.salt)
        archive = _nyeda.bundl()
        import colorama
        colorama.init()
        print(colorama.Fore.BLUE + 'Built:' + colorama.Fore.RESET, archive)
        colorama.deinit()
    else:
        if sys.platform == 'win32':
            getsuperuser()
        _nyeda = Nyeda(cfg.source, cfg.destination)
        archive = _nyeda.bundl()
        import colorama
        colorama.init()
        print(colorama.Fore.BLUE + 'Built:' + colorama.Fore.RESET, archive)
        colorama.deinit()